const strArray = `
    var strArray = "StackOverflow".split("");
    console.log(strArray.join(""));
`.trim();

const Sort = `
let i, j, arr=[0,9,8,7,6];
var max=0;

for(i=0; i<arr.length; i++){
  for(j=i; j<arr.length; j++){
    if(arr[i]>arr[j]){
      var temp=arr[i];
      arr[i]=arr[j];
      arr[j]=temp;
    }
  }
}

console.log(arr);


//Greatest Product Of 3
max = arr[arr.length-1] * arr[arr.length-2] * arr[arr.length-3]
console.log(max);
`.trim()

const duplicates = `
function removeDup(){
  const array = [1,2,3,4,3,0,9,0,1];
  const result=[];

  for(let i=0; i<array.length;i++){
      let count=0;
      for(let j=0;j<result.length;j++){
          if(array[i]==result[j]) count +=1;
      }
      if(count==0){
          result.push(array[i]);
      }  
  }

  console.log(result)
}

removeDup();
`.trim()

const compare_array = `
function compare(){
  const arr=[1,2,3,4,5,6];
  const arr2=[5,6,7,8,9,0];
  const result=[];

  for(let i=0; i<arr.length; i++){
    if(arr2.indexOf(arr[i]) !== -1){
      result.push(arr[i]);
    }
  }
  console.log(result)
}

compare();


//Unique name
function getUnique(){
  var names = ["John", "Peter", "Clark", "Harry", "John", "Alice"];
  var newName = [];

  for(i=0; i < names.length; i++){
      if(newName.indexOf(names[i]) === -1) {
          newName.push(names[i]);
      }
  }
  console.log(newName);
}

getUnique();
`.trim();

const findMedianSortedArrays = `
const median = () => {
  const arr = [1,12,15,26,38];
  const arr2 = [4,3,1];
  let arrMedian=[];

  const result = [...arr, ...arr2].sort((a, b) => a - b);
  const half = result.length / 2 | 0;

  if (result.length % 2){
      arrMedian=result[half];
  }
  else{
      arrMedian=((result[half] + result[half-1])/2);
  }
  return console.log(arrMedian);
}

median()
`.trim();

const maxSubArray = `
function maxSubArray(nums){
  let max = -Infinity;
  let currentMax = -Infinity;

  for (let i=0; i<nums.length; i++) {
    currentMax = Math.max(
      currentMax + nums[i],
      nums[i],
    )
    max = Math.max(max, currentMax)
  }
  return max
}

console.log(maxSubArray([-2,1,-3,4,-1,2,1,-5,4]))
`.trim();

const plusOne = `
function plusOne(){
  const arr=[1,2,3];
  let result=[], result2=[];
  let i;

  for(i=0; i<=arr.length-1; i++){
    result.push(arr[i]);
    result2 = arr[arr.length-1]+1
  }

  result.pop();
  result.push(result2);
  console.log(result)
}

plusOne();
`.trim();

const arrayCounter = `
function arrCounter(arr){
  var counter = 0;
  var maxCount = 0;

    function inner(n){
      if(!Array.isArray(n)){
        maxCount = Math.max(maxCount, counter);
     counter = 0;
     return
   }

   n.forEach(num => {
   counter ++;
   inner(num);
   })
 }

 inner(arr);
 console.log(maxCount)
 return maxCount;
}

arrCounter([[3]])
arrCounter([[[[[[[9]]]]]]])
arrCounter([])
`.trim()

const countElements = `
function arrCounts(){
  const arr = [1,2,3,4,5];
  var result = 0;

  while(arr[result]!==undefined){
    result++;
  }
  console.log(result);
}

arrCounts();  
`.trim();

